import axios from 'axios';

const API = axios.create({ baseURL: 'http://127.0.0.1:3002' });

export const generateImageByText = (formData) => API.post(`/comfy/generate/text2image`, formData);
export const generateImageByImage = (formData) => API.post(`/comfy/generate/image2image`, formData);
